const signupComponent=()=>{

    const handleSubmit=(e)=>{
        e.preventDefault()
        console.log("handle submit")
    }

    const handleChange=(e)=>{
        e.preventDefault()
        console.log(e.target.value)
    }

    const signupForm=()=>{
        return(
            <form onSubmit={handleSubmit}>
                <div className="form-group">
                    <input onChange={handleChange} type="text" className="form-control" placeholder="Enter name"></input>
                </div>
                <div className="form-group">
                    <input onChange={handleChange} type="email" className="form-control" placeholder="Enter email"></input>
                </div>
                <div className="form-group">
                    <input onChange={handleChange} type="text" className="form-control" placeholder="Enter password"></input>
                </div>
                <div>
                    <button className="btn btn-primary">Signup</button>
                </div>
            </form>
        )
    }

    return(
        <React.Fragment>
            {signupForm()}
        </React.Fragment>
    )
}

export default signupComponent
